  private # use this bit to regenerate the @@citation_style_names by hand, when updating the CSL gems
    def self.generate_constants
      time_start = Time.now
      new_style_names ||=
        CSLAdaptor.list.map do |cs|
          [CSLAdaptor.load(cs).title, cs]
        end
      puts "Took #{Time.now - time_start} seconds"
      File.open('/tmp/csl_names.txt', 'w') { |file| file.write( new_style_names.inspect ) }
    end
